syntax = "proto3";
package test;
service Model {
  rpc readValue(Noop) returns(_FromId);
  rpc updateValue(Noop) returns(_FromRef);
}
message _FromId {
  required _To data = 1;
}
message _FromRef {
  repeated _Target data = 1;
}
message _To {
  required string prop = 1;
}
message _Target {
  double value = 1;
}
message _Model {
  int32 noop = 1;
}
